import React, { Component } from 'react';
import './Header.css';
import HeaderLogo from '../assets/header.jpg';
import MenuIcon from '../assets/menu-icon.png';
import CloseIcon from '../assets/close-icon.png';

class Menu extends Component {
  constructor() {
    super();
    this.MenuSelect = this.MenuSelect.bind(this);
    this.state = {
      isClicked: false,
      src: MenuIcon
    }
  }

  MenuSelect() {

  }
}

class Header extends Component {
  render() {
    return(
      <div className="header d-md-none d-sm-flex flex-nowrap">
        <img className="menu" src={MenuIcon} height="60px"/>
        <div className="flex-grow-1">
          <img className="header-logo d-block mx-auto" src={HeaderLogo} height="60px"/>
        </div>
      </div>
    )
  }
}

export default Header;
